package push_dominoes

import "testing"

type testData struct {
	dominoes string
	expected string
}

func TestPD(t *testing.T) {
	tds := []testData{
		{
			dominoes: ".L.R...LR..L..",
			expected: "LL.RR.LLRRLL..",
		},
		{
			dominoes: ".",
			expected: ".",
		},
		{
			dominoes: "LLLRRR",
			expected: "LLLRRR",
		},
		{
			dominoes: ".L.RR.L.R.L..R..",
			expected: "LL.RR.L.R.L..RRR",
		},
		{
			dominoes: "L...",
			expected: "L...",
		},
		{
			dominoes: "R...",
			expected: "RRRR",
		},
	}

	for i, td := range tds {
		r := pushDominoesDep(td.dominoes)
		if r != td.expected {
			t.Fatalf("index %d expect %v got %v", i, td.expected, r)
		}
	}
}

func TestPDDFS(t *testing.T) {
	tds := []testData{
		// 当我把新增的力添加上了，那么就会导致本秒内本来可以倒的牌变成不能倒的
		{
			dominoes: ".L.R...LR..L..",
			expected: "LL.RR.LLRRLL..",
		},
		{
			dominoes: ".",
			expected: ".",
		},
		{
			dominoes: "LLLRRR",
			expected: "LLLRRR",
		},
		// 为什么每次最后R都不存在的原因在于原来倒数第二个R已经受力了一次，可是添加进来的时候又再次受力了，这是不对的
		{
			dominoes: ".L.RR.L.R.L..R..",
			expected: "LL.RR.L.R.L..RRR",
		},
		{
			dominoes: "L...",
			expected: "L...",
		},
		{
			dominoes: "R...",
			expected: "RRRR",
		},
		{
			dominoes: "L.L...L.L.LL.L..L...",
			expected: "LLLLLLLLLLLLLLLLL...",
		},
		{
			dominoes: ".LR......LL.LL",
			expected: "LLRRRRLLLLLLLL",
		},
		{
			dominoes: longDominoes,
			expected: longExpected,
		},
	}

	for i, td := range tds {
		r := pushDominoes(td.dominoes)
		if r != td.expected {
			t.Fatalf("index %d expect %v got %v", i, td.expected, r)
		}
	}
}

